import React from 'react';
import {
  Switch,
  Route,
  Redirect,
} from "react-router-dom";


const Website = () => {
  return (
    <>
      <Route path="/:page?">
        <Sidebar />
      </Route>    

      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Redirect to="/" />
      </Switch>

    </>
  );
};

export default Website;
